import React, {Component} from 'react';
import Link from 'next/link';

class IndexPage extends Component {
    render() {
        return (
            <div>
                <div>
                <Link href="/">На главную</Link>
                <Link href="/about-us">О нас</Link>
                </div>
                <h1>It works!</h1>
            </div>
        );
    }
}

export default IndexPage;
